import React from "react";
import closeIcon from "../images/Close_Icon.svg";
function ImagePopup({ name, isOpen, onClose, card }) {
  return (
    <div className={`popup popup_${props.name} ${props.isOpen}`}>
      <div className="img-popup__container">
        <button className="close-icon" type="button" onClick={props.onClose}>
          <img src={closeIcon} alt="Закрыть" className="close-icon__img" />
        </button>
        <img
          className="img-popup__picture"
          src={props.card.lik}
          alt={props.card.name}
        />
        <h2 className="img-popup__title"></h2>
      </div>
    </div>
  );
}
export default ImagePopup;
